inline fil_t fil_of_loc(square_t sq) { return ((sq >> FIL_SHIFT) & FIL_MASK) - FIL_ORIGIN; }
inline rnk_t rnk_of_loc(square_t sq) { return ((sq >> RNK_SHIFT) & RNK_MASK) - RNK_ORIGIN; }
static int beam[NUM_ORI] = {1, ARR_WIDTH, -1, -ARR_WIDTH};
int reflect2[NUM_ORI][NUM_ORI] = {
  //  NW  NE  SE  SW
  { -1, -1, EE, WW},   // NN
  { NN, -1, -1, SS},   // EE
  { WW, EE, -1, -1 },  // SS
  { -1, NN, SS, -1 }   // WW
};

inline int reflect_of_loc(int beam_dir, int pawn_ori) {
  tbassert(beam_dir >= 0 && beam_dir < NUM_ORI, "beam-dir: %d\n", beam_dir);
  tbassert(pawn_ori >= 0 && pawn_ori < NUM_ORI, "pawn-ori: %d\n", pawn_ori);
  return reflect2[beam_dir][pawn_ori];
}
